import React from "react";
import {prettyPrintStat} from "./operationsUtils";

import {Card,CardContent,Typography} from "@material-ui/core";

function InfoStats({title , count , total}){

    return(



        <Card className='infoStats'>

         <CardContent>

             <Typography className='infoStats_title' color='textSecondary'>{title}</Typography>

             <h4 className='infoStats_count'>prettyPrintStat({count})</h4>

             <Typography className='infoStats_total' color='textSecondary'>prettyPrintStat({total}) Total</Typography>


         </CardContent>


        </Card>



    );

}

export default InfoStats;
